import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header from './../../components/Header';
import Footer from './../../components/Footer';
import CoverPage from './../../components/CoverPage/TitleText';

class About extends Component {
  render() {
    return (
      <div>
        <Header />
        <CoverPage
          title="Sobre Nos"
          typing_arr_descriptions={[
            'Nossos Pilares',
            'Nossa Missao',
          ]} />
        About<br />
        About<br />
        About<br />
        About<br />
        About<br />
        About<br />
        <Footer />
      </div>
    );
  }
}
export default About;
